double sqrt(double x) {
  if (x <= 0.0) {
    return 0.0;
  }
  double guess = x;
  int i = 0;
  while (i < 10) {
    guess = (guess + x / guess) / 2.0;
    i = i + 1;
  }
  return guess;
}

double powf(double x, int n) {
  double res = 1.0;
  int i = 0;
  while (i < n) {
    res = res * x;
    i = i + 1;
  }
  return res;
}

int roundf(double x) {
  if (x >= 0.0) {
    return x + 0.5 as int;
  }
  return x - 0.5 as int;
}

List<int> fib_iterative(int n) {
  if (n < 0) {
    throw Exception("n is negative");
  }
  if (n == 0) {
    return [0];
  }
  List<int> fib = [0, 1];
  int i = 2;
  while (i <= n) {
    fib = [...fib, fib[i - 1] + fib[i - 2]];
    i = i + 1;
  }
  return fib;
}

int fib_recursive_term(int i) {
  if (i < 0) {
    throw Exception("n is negative");
  }
  if (i < 2) {
    return i;
  }
  return fib_recursive_term(i - 1) + fib_recursive_term(i - 2);
}

List<int> fib_recursive(int n) {
  if (n < 0) {
    throw Exception("n is negative");
  }
  List<int> res = <int>[];
  int i = 0;
  while (i <= n) {
    res = [...res, fib_recursive_term(i)];
    i = i + 1;
  }
  return res;
}

